import { BrowserRouter as Router, Route, S } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <Switch>
          <Route path="/" exact Component={Home}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
